CaveMap::CaveMap()
{

	Init();
	DrawOwnScn();

}

CaveMap::~CaveMap()
{
}

void CaveMap::SetMap(MAP_ID mapID)
{

	mMapID = mapID;

}

void CaveMap::Update(Vector2 offset)
{

	mOffset = { offset.x_,offset.y_ };

}

void CaveMap::DrawOwnScn()
{

	for (int y = 0; y < MAP_Y; y++)
	{
		for (int x = 0; x < MAP_X; x++)
		{

			DrawGraph(32 * x - mOffset.x_, 32 * y - mOffset.y_, mChipImage[cave_ground[y][x]], true);
			DrawGraph(32 * x - mOffset.x_, 32 * y - mOffset.y_, mChipImage[cave_wall[y][x]], true);
			DrawGraph(32 * x - mOffset.x_, 32 * y - mOffset.y_, mChipImage[cave_obj[y][x]], true);
			//DrawFormatString(32 * x - mOffset.x_, 32 * y - mOffset.y_, GetColor(255, 0, 0), "%d", cave_obj[y][x]);

			DrawFormatString(0, 10, GetColor(0, 0, 255), "mapPos=(%d,%d)", mOffset.x_, mOffset.y_);

		}
	}

}

bool CaveMap::Init(void)
{

	if (LoadDivGraph("./image/A1.png", 378, 9, 42, 32, 32, &mChipImage[0]) == -1)
	{
		return false;
	}

	return true;
}

bool CaveMap::CheckMapChip(Vector2 pos)
{
	
	layer1 = cave_ground[pos.y_ / 32][pos.x_ / 32];
	layer2 = cave_wall[pos.y_ / 32][pos.x_ / 32];
	layer3 = cave_obj[pos.y_ / 32][pos.x_ / 32];
	

	bool flg = false;	//true=player
	
		//s
	switch (layer1)
	{
	case 28:
	case 73:
	case 144:
	case 297:
	case 298:
	case 299:
	case 306:
	case 307:
	case 308:
	case 315:
	case 316:
	case 317:
	case 324:
	case 325:
	case 326:
	case 333:
	case 335:
	case 342:
	case 343:
	case 344:
		
		switch (layer2)
		{
		case -1:
		case 23:
		case 24:
		case 25:
		case 31:
		case 32:
		case 33:
		case 41:
		case 42:
		case 43:
		case 72:


			switch (layer3)
			{
			case -1:
			case 59:
			case 68:
			case 77:
			case 93:
			case 174:
			case 175:
			case 183:
			case 184:

				flg = true;
				break;
			default:
				break;
			}
			break;
		default:
			break;
		}
		break;
	default:
		break;
	}

	return flg;
	 
}

int CaveMap::GetMapChip(Vector2 pos)
{
	return cave_wall[pos.y_ / 32][pos.x_ / 32];
}
